import { StatusBar } from 'expo-status-bar';
import React from 'react';
import { ActivityIndicator, StyleSheet, Text, View, TouchableOpacity, Image } from 'react-native';

const MainScreen = props => {
  return (
    <View style={styles.container}>


      <StatusBar style="auto"  backgroundColor= "#368cb3" />
      <Text style={{fontSize: 20, color: '#427f95', marginTop: 30 }}>Nizam's Institute of Medical Sciences</Text>
      <Text style={{fontSize: 13, color: '#427f95'  }}>(A University Established Under State Act)</Text>
      <Text style={{fontSize: 17, color: '#427f95'  }}>Hyderbad 500082 Telangana, India</Text>


      <Image style={{height: 160, width: 140, margin: 30,}} source={require('../assets/nimslogo_liteblue.png')} />

        <TouchableOpacity style={styles.appButtonContainer} 
        onPress={() => { props.navigation.navigate({routeName: 'EmployeeLogin'}); }} >
        <Text style={styles.appButtonText}>Employee Login</Text>
        </TouchableOpacity>

        <TouchableOpacity style={styles.appButtonContainer} 
        onPress={() => { props.navigation.navigate({routeName: 'DoctorLogin'}); }} >
        <Text style={styles.appButtonText}>Doctor Desk Login</Text>
        </TouchableOpacity>

        <TouchableOpacity style={styles.appButtonContainer} 
        onPress={() => { props.navigation.navigate({routeName: 'PatientLogin'}); }} >
        <Text style={styles.appButtonText}>Patient LogIn</Text>
        </TouchableOpacity>

      <Image style={{height: 70, width: 180, marginTop: 60}} source={require('../assets/toolbarlogo1.png')} />

    </View>
  );
}



const styles = StyleSheet.create({
  container: {
    backgroundColor: '#eef2f7',
    alignItems: 'center',
    justifyContent: 'center',
    flexDirection: 'column',
    marginTop: 80,
  },
  appButtonContainer: {
    marginTop: 15,
    backgroundColor: "#368cb3",
    borderRadius: 25,
    width: 260,
    paddingVertical: 10,
    paddingHorizontal: 12
  },
  appButtonText: {
    fontSize: 15,
    color: "#fff",
    fontWeight: "bold",
    alignSelf: "center",
    textTransform: "uppercase"
  },

});

export default MainScreen;
